import Vue from 'vue'
import Router from 'vue-router'
//1.1:加载Home组件
import HomeContainer from "./components/tabbar/HomeContainer.vue"
import member from "./components/tabbar/member.vue"
import search from "./components/tabbar/search.vue"
import cart from "./components/tabbar/cart.vue"
import New from "./components/tabbar/NewsList.vue"
import Newsinfo from "./components/tabbar/Newsinfo.vue"
import PhotoList from "./components/photos/PhotoList.vue"

Vue.use(Router)

export default new Router({
  routes: [
    {path:"/",redirect:"/home"},
    {
      //path 组件访问路由
      //如果访问/home a  <router-link to="/home">...
      path: '/home',component: HomeContainer
    },
    {path:"/member",component: member},
    {path:"/search",component: search},
    {path:"/cart",component: cart},
    {path:"/New",component: New},
    {path:"/Newsinfo/:id",component: Newsinfo},
    {path:"/PhotoList/:id",component: PhotoList}
  ]
})
